import React from 'react';
import './Works.css';

const WorkItem = ({ title, description, image }) => (
  <div className="work-item">
    <img src={image} alt={title} className="work-image" />
    <div className="work-content">
      <h3>{title}</h3>
      <p>{description}</p>
    </div>
  </div>
);

const Works = () => {
  const projects = [
    {
      title: "Narasimha Enterprises Hospitality",
      description: "A comprehensive hospitality management website showcasing services, team, and clients.",
      image: "path/to/narasimha-image.jpg"
    },
    {
      title: "Relish Hospitality Services",
      description: "Full-featured website for hospitality management with sections for About Us, Services, Team, and Clients.",
      image: "path/to/relish-image.jpg"
    },
    // Add more projects as needed
  ];

  return (
    <div className="works-container">
      <h1>My Works</h1>
      <div className="works-grid">
        {projects.map((project, index) => (
          <WorkItem key={index} {...project} />
        ))}
      </div>
    </div>
  );
};

export default Works;
